function LoadSketchAPIMain() {
    return {"title":"Hotlist API","author":{"nickname":"Infinite coder","link":"https://www.khanacademy.org/profile/markusprograms/"},"size":{"width":400,"height":600},"link":"https://www.khanacademy.org/computer-programming/hotlist-api/5234045946740736","img":"https://www.khanacademy.org/computer-programming/hotlist-api/5234045946740736/5121620907966464.png","created":"2023-03-10T20:31:20.379627Z","flags":{"flags":null,"flaggedBy":null},"type":"webpage","code":"&lt;!DOCTYPE html>\n&lt;html>\n    &lt;head>\n        &lt;meta charset=\"utf-8\">\n        &lt;title>Hotlist API&lt;/title>\n        &lt;script src = \"https://cdn.jsdelivr.net/gh/Infinite-Coder-001/Hotlist-API@1.6.0/main.js\">&lt;/script>\n        \n        &lt;link rel=\"preconnect\" href=\"https://fonts.googleapis.com\">\n        &lt;link rel=\"preconnect\" href=\"https://fonts.gstatic.com\" crossorigin>\n        &lt;link href=\"https://fonts.googleapis.com/css2?family=Roboto:wght@900&display=swap\" rel=\"stylesheet\">\n        \n        &lt;link rel=\"preconnect\" href=\"https://fonts.googleapis.com\">\n        &lt;link rel=\"preconnect\" href=\"https://fonts.gstatic.com\" crossorigin>\n        &lt;link href=\"https://fonts.googleapis.com/css2?family=Roboto:wght@400&display=swap\" rel=\"stylesheet\">\n        \n        &lt;style>\n            #bottomDiv {\n                background-image: url(\"https://upload.wikimedia.org/wikipedia/commons/thumb/c/c7/Airports_Network_Map.png/1024px-Airports_Network_Map.png\");\n                border: 1px solid black;\n                text-align: center;\n                color: white;\n            }\n            body {\n                background-color: white;\n                font-family: 'Roboto', sans-serif;\n                margin: 0;\n                overflow-x: hidden;\n            }\n            #titleImage {\n                position: fixed;\n                top: -2px;\n                left: -2px;\n                filter: blur(2px);\n                -webkit-filter: blur(2px);\n                height: calc(100vh + 4px);\n            }\n            #titleFrame {\n                position: fixed;\n                background-size: cover;\n                text-align: center;\n                padding-top: 110px;\n                height: calc(100vh - 110px);\n                padding-left: 50px;\n            }\n            #title {\n                color: white;\n                font-size: 100px;\n                margin-bottom: 0;\n                text-decoration: underline;\n                text-shadow: 0 0 5px white;\n            }\n            #title2 {\n                margin-top: 30px;\n                color: rgb(0, 200, 0);\n                text-shadow: 0 0 5px rgb(0, 200, 0);\n            }\n            #main {\n                font-family: 'Roboto', sans-serif;\n                position: absolute;\n                top: 100vh;\n                left: 0;\n                background-color: white;\n                width: calc(100vw - 35px);\n                padding: 10px;\n            }\n            .code {\n                font-family: monospace;\n                padding: 5px;\n                border-radius: 5px;\n                line-height: 1.5;\n                background-color: black;\n                color: white;\n            }\n            hr {\n                margin: 0;\n                width: calc(100vw - 40px);\n                color: rgba(0, 0, 0, 0);\n            }\n            .hidden {\n                width: 0;\n            }\n            p {\n                line-height: 1.5;\n                margin: 0;\n            }\n            li {\n                line-height: 1.5;\n            }\n            demo {\n                \n            }\n            .output {\n                height: 300px;\n                overflow: auto;\n                border: 1px solid grey;\n            }\n            \n            table {\n                font-family: arial, sans-serif;\n                border-collapse: collapse;\n                white-space: nowrap;\n            }\n\n            td, th {\n                border: 1px solid #dddddd;\n                text-align: left;\n                padding: 8px;\n            }\n\n            th {\n                text-align: center;\n            }\n\n            tr:nth-child(even) {\n                background-color: #dddddd;\n            }\n            \n            .hotlistDiv {\n                font-family: Lato, \"Noto Sans\", sans-serif;\n                float: left;\n                margin: 25px;\n            }\n            .thumbnail {\n                width: 200px;\n                height: 200px;\n                border: 1px solid rgba(33,36,44,0.16);\n            }\n            .titleLink {\n                font-family: Lato, \"Noto Sans\", sans-serif;\n                display: block;\n                font-weight: 700;\n                line-height: 20px;\n                overflow: hidden;\n                text-overflow: ellipsis;\n                white-space: nowrap;\n                width: 200px;\n                color: #1865f2;\n            }\n            .authorLink {\n                font-family: Lato, \"Noto Sans\", sans-serif;\n                display: block;\n                font-size: 14px;\n                overflow: hidden;\n                text-overflow: ellipsis;\n                white-space: nowrap;\n                width: 200px;\n            }\n            .votesForks {\n                font-family: Lato, \"Noto Sans\", sans-serif;\n                font-size: 15px;\n                margin: 0px;\n                padding: 0px;\n                color: rgba(33,36,44,0.64);\n            }\n            #hotlistOutput a {\n                font-family: Lato, \"Noto Sans\", sans-serif;\n                text-decoration: none;\n            }\n            #hotlistOutput a:hover {\n                font-family: Lato, \"Noto Sans\", sans-serif;\n                text-decoration: underline;\n            }\n            #hotlistOutput a:visited {\n                font-family: Lato, \"Noto Sans\", sans-serif;\n                color: #1865f2;\n            }\n        &lt;/style>\n    &lt;/head>\n    &lt;body>\n        &lt;img id = \"titleImage\" src = \"https://upload.wikimedia.org/wikipedia/commons/thumb/c/c7/Airports_Network_Map.png/1024px-Airports_Network_Map.png\">\n        &lt;div id = \"titleFrame\">\n            &lt;h1 id = \"title\">Hotlist API&lt;/h1>\n            &lt;h1 id = \"title2\">KA API working again&lt;/h1>\n        &lt;/div>\n        &lt;div id = \"main\">\n            &lt;!-- ABOUT -->\n            &lt;h1>About&lt;/h1>\n            &lt;p>Khan Academy API was shut down, but you can still access data from Khan Academy by using &lt;b>Hotlist API&lt;/b>. In this guide, you'll learn, how to get data from KA hotlist. &lt;/p>\n            \n            &lt;!-- CREDITS -->\n            &lt;h1>Credits&lt;/h1>\n            &lt;p>Hotlist API was programmed by &lt;b>Infinite coder&lt;/b> (me). &lt;/p>\n            &lt;p>Credit to &lt;b>Sprout&lt;/b> for helping me with github action setup. &lt;/p>\n            &lt;p>If you use this API, please give credit. You can simply add this element to your HTML code: &lt;/p>&lt;br>\n            &lt;div class = \"code\">\n&#60;div style = 'font-family: Lato, \"Noto Sans\", sans-serif; float: left; margin: 25px; background-color: lightblue; width: calc(100vw - 100px); border-radius: 5px; text-align: center; padding: 10px; margin-bottom: 0;'>Made with Hotlist API: &#60;a href = \"https://www.khanacademy.org/computer-programming/hotlist-api/5234045946740736\">https://www.khanacademy.org/computer-programming/hotlist-api/5234045946740736&#60;/a>&#60;/div>&lt;/div>&lt;br>\n            &lt;b>Live demo: &lt;/b>\n            &lt;div class = \"output\">\n                &lt;div style = 'font-family: Lato, \"Noto Sans\", sans-serif;float: left;margin: 25px;background-color: lightblue;width: calc(100vw - 100px);border-radius: 5px;text-align: center;padding: 10px;margin-bottom: 0;'>Made with Hotlist API: &lt;a href = \"https://www.khanacademy.org/computer-programming/hotlist-api/5234045946740736\" target = \"_blank\">https://www.khanacademy.org/computer-programming/hotlist-api/5234045946740736&lt;/a>&lt;/div>\n            &lt;/div>\n            &lt;hr class = \"hidden\">&lt;br>\n            &lt;p>Or just put &lt;a class = \"code\">&#60;!-- Made with Hotlist API: https://www.khanacademy.org/computer-programming/hotlist-api/5234045946740736 -->&lt;/a> to the top of the code. &lt;/p>\n            \n            &lt;!-- HOW IT WORKS -->\n            &lt;h1>How it works&lt;/h1>\n            &lt;p>On Github, there's an action, that loads data from KA hotlist every minute, then writes it into a file. &lt;/p>\n            &lt;p>Your sketch connects through Jsdelivr to Github and loads the file. Connecting to Jsdelivr (and Github) is &lt;b>allowed&lt;/b> by KA guidelines, it's 100% safe. &lt;/p>\n            \n            &lt;!-- GETTING STARTED -->\n            &lt;h1>Getting started&lt;/h1>\n            &lt;ol>\n                &lt;li>Create a new &lt;b>webpage&lt;/b> on Khan Academy. &lt;/li>&lt;br>\n                \n                &lt;li>Add &lt;a class = \"code\">&#60;script src = \"https://cdn.jsdelivr.net/gh/Infinite-Coder-001/Hotlist-API@1.6.0/main.js\">&#60;/script>&lt;/a> to the head. &lt;/li>&lt;br>\n                &lt;li>Add &lt;a class = \"code\">&#60;p id = \"demo\">&#60;/p>&lt;/a> to the body. &lt;/li>&lt;br>\n                &lt;li>Add an empty script tag to the body. &lt;/li>&lt;br>\n                &lt;li>Add a function (for example &lt;a class = \"code\">myCallback&lt;/a>) with one parameter (for example &lt;a class = \"code\">data&lt;/a>) in the script. &lt;/li>&lt;br>\n                &lt;li>Call &lt;a class = \"code\">HotlistAPI(myCallback);&lt;/a> to the script outside of the function. &lt;/li>&lt;br>\n                &lt;li>Add &lt;a class = \"code\">document.getElementById(\"demo\").innerHTML = JSON.stringify(data);&lt;/a> to the function. &lt;/li>\n            &lt;/ol>\n            &lt;b>The code should look like: &lt;/b>\n            &lt;pre class = \"code\">\n&lt;!DOCTYPE html>\n&lt;html>\n    &lt;head>\n        &lt;title>New program&lt;/title>\n        &lt;script src = \"https://cdn.jsdelivr.net/gh/Infinite-Coder-001/Hotlist-API@1.2.0/main.js\">&lt;/script> \n    &lt;/head>\n    &lt;body>\n        &lt;p id = \"demo\">&lt;/p>\n        &lt;script>\n            function myCallback(data) {\n                document.getElementById(\"demo\").innerHTML = JSON.stringify(data); \n            }\n            HotlistAPI(myCallback); \n        &lt;/script>\n    &lt;/body>\n&lt;/html>\n            &lt;/pre>&lt;br>\n            &lt;b>Live demo: &lt;/b>\n            &lt;div class = \"output\">\n                &lt;p id = \"demo\">&lt;/p>\n                &lt;script>\n                    function myCallback(data) {\n                        document.getElementById(\"demo\").innerHTML = JSON.stringify(data); \n                    }\n                    HotlistAPI(myCallback); \n                    setInterval(function() {\n                        HotlistAPI(myCallback);\n                    }, 60 * 1000);\n                &lt;/script>\n            &lt;/div>\n            &lt;br>\n            &lt;p>So you get scratchpads of top 100 programs on the hotlist. Each scratchpad contains title, author, votes, forks, thumbnail image link, link to the program and link to the author. &lt;/p>\n    \n            &lt;!-- AUTO-REFRESH -->\n            &lt;h1>Auto-refresh&lt;/h1>\n            &lt;p>Doing an auto-refresh is very simple: just call the &lt;a class = \"code\">HotlistAPI&lt;/a> function again. Add this code after &lt;a class = \"code\">HotlistAPI(myCallback);&lt;/a>: &lt;/p>&lt;br>\n            &lt;pre class = \"code\">\n            setInterval(function() {\n                HotlistAPI(myCallback);\n            }, 60 * 1000);\n            &lt;/pre>\n            \n            &lt;!-- CREATING A TABLE -->\n            &lt;h1>Creating a table&lt;/h1>\n            &lt;p>You can use this code to create a table of the data, that you get (please give credit, if you Copy&Paste the code): &lt;/p>&lt;br>\n            &lt;pre class = \"code\">\n&lt;!DOCTYPE html>\n&lt;html>\n    &lt;head>\n        &lt;title>New program&lt;/title>\n        &lt;script src = \"https://cdn.jsdelivr.net/gh/Infinite-Coder-001/Hotlist-API@1.2.0/main.js\">&lt;/script> \n        &lt;style>\n            table {\n                font-family: arial, sans-serif;\n                border-collapse: collapse;\n                white-space: nowrap;\n            }\n\n            td, th {\n                border: 1px solid #dddddd;\n                text-align: left;\n                padding: 8px;\n            }\n\n            th {\n                text-align: center;\n            }\n\n            tr:nth-child(even) {\n                background-color: #dddddd;\n            }\n        &lt;/style>\n    &lt;/head>\n    &lt;body>\n        &lt;table id = \"demo\">&lt;/table>\n        &lt;script>\n            function myCallback(data) {\n                var data2 = \"\";\n                \n                for (var i = 0; i &lt; data.length; i ++) {\n                    data2 += \"&lt;tr>\";\n                    data2 += \"&lt;td>\" + data[i].title + \"&lt;/td>\";\n                    data2 += \"&lt;td>\" + data[i].author + \"&lt;/td>\";\n                    data2 += \"&lt;td>\" + data[i].votes + \"&lt;/td>\";\n                    data2 += \"&lt;td>\" + data[i].forks + \"&lt;/td>\";\n                    data2 += \"&lt;td>\" + data[i].thumbnail + \"&lt;/td>\";\n                    data2 += \"&lt;td>\" + data[i].link + \"&lt;/td>\";\n                    data2 += \"&lt;td>\" + data[i].authorLink + \"&lt;/td>\";\n                    data2 += \"&lt;/tr>\";\n                }\n                \n                document.getElementById(\"demo\").innerHTML = \"&lt;tr>&lt;th>Title&lt;/th>&lt;th>Author&lt;/th>&lt;th>Votes&lt;/th>&lt;th>Forks&lt;/th>&lt;th>Thumbnail&lt;/th>&lt;th>Link&lt;/th>&lt;th>Author link&lt;/th>&lt;/tr>\" + data2;\n            }\n            function loadData() {\n                HotlistAPI(myCallback);\n            }\n            loadData();\n            setInterval(loadData, 60 * 1000);\n        &lt;/script>\n    &lt;/body>\n&lt;/html>\n            &lt;/pre>&lt;br>\n            &lt;b>Live demo: &lt;/b>\n            &lt;div class = \"output\">\n                &lt;table id = \"demo2\">&lt;/table>&lt;br>\n                &lt;script>\n                    function myCallback(data) {\n                        var data2 = \"\";\n                        \n                        for (var i = 0; i &lt; data.length; i ++) {\n                            data2 += \"&lt;tr>\";\n                            data2 += \"&lt;td>\" + data[i].title + \"&lt;/td>\";\n                            data2 += \"&lt;td>\" + data[i].author + \"&lt;/td>\";\n                            data2 += \"&lt;td>\" + data[i].votes + \"&lt;/td>\";\n                            data2 += \"&lt;td>\" + data[i].forks + \"&lt;/td>\";\n                            data2 += \"&lt;td>\" + data[i].thumbnail + \"&lt;/td>\";\n                            data2 += \"&lt;td>\" + data[i].link + \"&lt;/td>\";\n                            data2 += \"&lt;td>\" + data[i].authorLink + \"&lt;/td>\";\n                            data2 += \"&lt;/tr>\";\n                        }\n                        \n                        document.getElementById(\"demo2\").innerHTML = \"&lt;tr>&lt;th>Title&lt;/th>&lt;th>Author&lt;/th>&lt;th>Votes&lt;/th>&lt;th>Forks&lt;/th>&lt;th>Thumbnail&lt;/th>&lt;th>Link&lt;/th>&lt;th>Author link&lt;/th>&lt;/tr>\" + data2;\n                    }\n                    function loadData() {\n                        HotlistAPI(myCallback);\n                    }\n                    loadData();\n                    setInterval(loadData, 60 * 1000);\n                &lt;/script>\n            &lt;/div>\n            \n            &lt;!-- HOTLIST CLONE -->\n            &lt;h1>Hotlist clone&lt;/h1>\n            &lt;p>You're able to make a clone of KA hotlist with this API! Here's the code (don't remove the credit please): &lt;/p>&lt;br>\n            &lt;pre class = \"code\">\n    &lt;!DOCTYPE html>\n    &lt;html>\n        &lt;head>\n            &lt;meta charset=\"utf-8\">\n            &lt;title>Live hotlist&lt;/title>\n            &lt;script src = \"https://cdn.jsdelivr.net/gh/Infinite-Coder-001/Hotlist-API@1.2.0/main.js\">&lt;/script>\n            &lt;style>\n                body {\n                    font-family: Lato, \"Noto Sans\", sans-serif;\n                }\n                div {\n                    float: left;\n                    margin: 25px;\n                }\n                .thumbnail {\n                    width: 200px;\n                    height: 200px;\n                    border: 1px solid rgba(33,36,44,0.16);\n                }\n                .titleLink {\n                    display: block;\n                    font-weight: 700;\n                    line-height: 20px;\n                    overflow: hidden;\n                    text-overflow: ellipsis;\n                    white-space: nowrap;\n                    width: 200px;\n                    color: #1865f2;\n                }\n                .authorLink {\n                    display: block;\n                    font-size: 14px;\n                    overflow: hidden;\n                    text-overflow: ellipsis;\n                    white-space: nowrap;\n                    width: 200px;\n                }\n                .votesForks {\n                    font-size: 15px;\n                    margin: 0px;\n                    padding: 0px;\n                    color: rgba(33,36,44,0.64);\n                }\n                a {\n                    text-decoration: none;\n                }\n                a:hover {\n                    text-decoration: underline;\n                }\n                a:visited {\n                    color: #1865f2;\n                }\n            &lt;/style>\n        &lt;/head>\n        &lt;body>\n            &lt;div style = 'font-family: Lato, \"Noto Sans\", sans-serif; float: left; margin: 25px; background-color: lightblue; width: calc(100vw - 100px); border-radius: 5px; text-align: center; padding: 10px; margin-bottom: 0;'>Made with Hotlist API: &lt;a href = \"https://www.nothing.com\">https://www.nothing.com&lt;/a>&lt;/div>\n            &lt;div id = \"main\">&lt;/div>\n            \n            &lt;script>  \n                console.clear();\n                \n                function update(data) {\n                    // This function is called, when all data is loaded\n                    var data2 = \"\";\n                        \n                    for (var i = 0; i &lt; data.length; i ++) {\n                        data2 += \"&lt;div>\";\n                        \n                        // The thumbnail\n                        data2 += \"&lt;a href = '\" + data[i].link + \"' target = '_blank'>&lt;img class = 'thumbnail' src = '\" + data[i].thumbnail + \"'>&lt;/a>\";\n                        \n                        // The title\n                        data2 += \"&lt;a class = 'titleLink' target = '_blank' href = '\" + data[i].link + \"'>\" + data[i].title + \"&lt;/a>\";\n                        // The author\n                        data2 += \"&lt;a class = 'authorLink' target = '_blank' href = '\" + data[i].authorLink + \"'>\" + data[i].author + \"&lt;/a>\";\n                        \n                        // Votes and forks\n                        data2 += \"&lt;div class = 'votesForks'>\" + data[i].votes + \" \" + String(data[i].votes === 1 ? \"Vote\" : \"Votes\") + \" ï¿½ \" + data[i].forks + \" \" + String(data[i].forks === 1 ? \"Spin-Off\" : \"Spin-Offs\") + \"&lt;/div>\";\n                        \n                        data2 += \"&lt;/div>\";\n                    }\n                        \n                    document.getElementById(\"main\").innerHTML = data2;\n                }\n                \n                HotlistAPI(update); // Updating the hotlist on program start\n                \n                setInterval(function() {\n                    HotlistAPI(update); // Then every minute\n                }, 60 * 1000);\n            &lt;/script>\n        &lt;/body>\n    &lt;/html>\n            &lt;/pre>&lt;br>\n            &lt;b>Live demo: &lt;/b>\n            &lt;div class = \"output\" id = \"hotlistOutput\">\n            &lt;div style = 'font-family: Lato, \"Noto Sans\", sans-serif; float: left; margin: 25px; margin-left: 13px; background-color: lightblue; width: calc(100vw - 100px); border-radius: 5px; text-align: center; padding: 10px; margin-bottom: 0;'>Made with Hotlist API: &lt;a href = \"https://www.khanacademy.org/computer-programming/hotlist-api/5234045946740736\">https://www.khanacademy.org/computer-programming/hotlist-api/5234045946740736&lt;/a>&lt;/div>\n            &lt;div id = \"main2\">&lt;/div>\n            \n            &lt;script>  \n                function update(data) {\n                    // This function is called, when all data is loaded\n                    setTimeout(function() {\n                        var data2 = \"\";\n                            \n                        for (var i = 0; i &lt; data.length; i ++) {\n                            data2 += \"&lt;div class = 'hotlistDiv'>\";\n                            \n                            // The thumbnail\n                            data2 += \"&lt;a href = '\" + data[i].link + \"' target = '_blank'>&lt;img class = 'thumbnail' src = '\" + data[i].thumbnail + \"'>&lt;/a>\";\n                            \n                            // The title\n                            data2 += \"&lt;a class = 'titleLink' target = '_blank' href = '\" + data[i].link + \"'>\" + data[i].title + \"&lt;/a>\";\n                            \n                            // The author\n                            data2 += \"&lt;a class = 'authorLink' target = '_blank' href = '\" + data[i].authorLink + \"'>\" + data[i].author + \"&lt;/a>\";\n                            \n                            // Votes and forks\n                            data2 += \"&lt;div class = 'votesForks'>\" + data[i].votes + \" \" + String(data[i].votes === 1 ? \"Vote\" : \"Votes\") + \" &middot; \" + data[i].forks + \" \" + String(data[i].forks === 1 ? \"Spin-Off\" : \"Spin-Offs\") + \"&lt;/div>\";\n                            \n                            data2 += \"&lt;/div>\";\n                        }\n                            \n                        document.getElementById(\"main2\").innerHTML = data2;\n                    }, 1000);\n                }\n                \n                HotlistAPI(update); // Updating the hotlist on program start\n                \n                setInterval(function() {\n                    HotlistAPI(update); // Then every minute\n                }, 60 * 1000);\n            &lt;/script>\n            &lt;/div>\n            \n            &lt;!-- HELP REQUEST -->\n            &lt;h1>Help request&lt;/h1>\n            &lt;p>If you saved any scratchpad from the original API send me it in Tips&Thanks. Thanks for help. &lt;/p>\n            \n            &lt;!-- ISSUES -->\n            &lt;h1>Issues&lt;/h1>\n            &lt;p>If you found an issue, you can report it in Tips&Thanks. But before you report it, make sure, that: &lt;/p>\n            &lt;ul>\n                &lt;li>Nobody reported the issue before you. &lt;/li>\n                &lt;li>You don't have resticted access to Jsdelivr or Github. &lt;/li>\n                &lt;li>You read this whole documentation. &lt;/li>\n                &lt;li>You don't have a mistake in your code. &lt;/li>\n            &lt;/ul>\n            &lt;p>When reporting a bug, please clearly describe the bug, tell me which device do you use (operation system and version) and which browser do you use (and version). If possible, send me a link to your project. &lt;/p>\n            &lt;h3>Known issues: &lt;/h3>\n            &lt;ul>\n                &lt;li>\n                    &lt;b>The data is old (up to 2 hours delay)&lt;/b>&lt;br>\n                    &lt;p>&lt;b>Solution: &lt;/b>Github Actions sometimes don't work right, I'm currently working on fixing that. &lt;/p>\n                &lt;/li>\n            &lt;/ul>\n            \n            &lt;!-- QUESTIONS -->\n            &lt;h1>Questions&lt;/h1>\n            &lt;p>If you have any questions, fell free to ask in Questions section. &lt;/p>\n            \n            &lt;!-- COMING SOON: -->\n            &lt;h1>Coming soon: &lt;/h1>\n            &lt;p>More API options and also loading data from exteranl sites are comming soon. Post a period into Tips&Thanks to a special thread to subscribe for new API programs. If you want to subscribe to all my program, go to my subpage: &lt;/p>&lt;a href = \"https://www.khanacademy.org/cs/i/6251203022864384\">https://www.khanacademy.org/cs/i/6251203022864384&lt;/a>&lt;br>&lt;br>\n            \n            &lt;div id = \"bottomDiv\">\n                &lt;h1>That's all! &lt;/h1>\n                &lt;h1>Good luck coding :)&lt;/h1>\n            &lt;/div>\n        \n        &lt;/div>\n        \n        &lt;script>\n            setInterval(function() {\n                document.getElementById(\"titleFrame\").style.filter = \"brightness(\" + (600 - document.documentElement.scrollTop * 1) / 600 + \")\";\n                document.getElementById(\"titleImage\").style.filter = \"blur(2px) brightness(\" + (600 - document.documentElement.scrollTop * 1) / 600 + \")\";\n            }, 1);\n        &lt;/script>\n    &lt;/body>\n&lt;/html>","voteCount":47,"forkCount":4};
}